import styled from "styled-components";

const StyledContact = styled.div`
.contact-me {
    text-align: center;
    margin-bottom: 40px;
    }

    .Pro {
        color: salmon;
        margin: 1rem;
        font-size: 2.44rem;
        text-align: center;
    }

    .social-links {
        display: flex;
        justify-content: center;
    }

    a {
        display: inline-block;
        margin: 0 6px;
    }

    .logo {
        width: 50px;
        height: 25px;
    }
`;
export default StyledContact;
